export const Card = () => {

    function handleClick() {
        props.onCardClick(props.card)
    }

    return(
        <template className="template">
        <li class="element">
            <button class="element__back" tupe="button"></button>
            <img src={props.card.link} className="element__foto" alt={props.card.name} onClick={handleClick}/>
            <h2 className="element__title">Карачаевск</h2>
            <div className="element__like-form">
                <button className="element__like" type="button"></button>
                <div className="element__like-count">0</div>
            </div>
        </li>
    </template>
    )
}
